import React from 'react';
// import Question1 from '../components/Question1/index';
import Question2 from '../components/Question2/index';
import Question3 from '../components/Question3/index';
import Question4 from '../components/Question4/index';
import Question5 from '../components/Question5/index';
import Question6 from '../components/Question6/index';
import Question7 from '../components/Question7/index';
import Question8 from '../components/Question8/index';
import AddTripQuestions from '../assets/questions/questions';

import '../index.css';

class AddTrip extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            currentQuestion: 1, // default first step
            startpoint: '',
            endpoint: '',
            budget: null,
            people: 0,
            vehicle: [],
            dates: Date(),
            stops: [],
            night: '',
        }

        this._next = this._next.bind(this);

        this.handleChange = this.handleChange.bind(this);
    }

    _next() {
        let currentQuestion = this.state.currentQuestion;
        currentQuestion = currentQuestion >= 2? 3: currentQuestion + 1;
        this.setState({
            currentQuestion: currentQuestion
        })
    }

    handleChange(event) {
        const { username, value } = event.target
        this.setState({
            [username]: value
        });
    }

    get nextButton() {
        let currentQuestion = this.state.currentQuestion;
        if (currentQuestion < 9)  {
            return(
                <button className="btn btn-primary float-right" type="button" onClick={this._next}>Next</button>
            )
        }
        return null;
    }

    handleSubmit = (event) => {
        event.preventDefault();
        const { startpoint, endpoint, budget, people, vehicle, dates, stops, night } = this.state;
        alert(`Your details: \n
            Starting: ${startpoint}
            Ending: ${endpoint}
        `)
    }

    render() {
        return(
            <div className="row">
                <div className="col-sm-12 questionheader">
                    <form onSubmit={this.handleSubmit}>
                    <Question1 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        startpoint={this.state.startpoint}
                    />
                    <Question2 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        endpoint={this.state.endpoint}
                    />
                    <Question3 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        budget={this.state.budget}
                    />
                    <Question4 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        people={this.state.people}
                    />
                    <Question5 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        vehicle={this.state.vehicle}
                    />
                    <Question6 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        dates={this.state.dates}
                    />
                    <Question7 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        stops={this.state.stops}
                    />
                    <Question8 
                        currentQuestion={this.state.currentQuestion}
                        handleChange={this.handleChange}
                        night={this.state.night}
                    />
                    </form>
                </div>
            </div>
        );
    }
}

function Question1 (props) {
    if (props.currentQuestion != 1) {
        return null;
    }
    return (
        <div>
            <h3>Where's your starting point?</h3>
            <Dropdown>
                <Dropdown.Toggle className="dropdown">
                    Choose your country
                </Dropdown.Toggle>

                <Dropdown.Menu>
                    <Dropdown.Item href="#/action-1">1</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
            <Dropdown>
                <Dropdown.Toggle className="dropdown">
                    Choose your state
                </Dropdown.Toggle>

                <Dropdown.Menu>
                    <Dropdown.Item href="#/action-1">1</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
            <Dropdown>
                <Dropdown.Toggle className="dropdown">
                    Choose your city
                </Dropdown.Toggle>

                <Dropdown.Menu>
                    <Dropdown.Item href="#/action-1">1</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
            </div>
        );

}





export default AddTrip;
